import React from 'react';
import { useNavigate } from 'react-router-dom';
import { FaSearch, FaShoppingCart, FaUser } from 'react-icons/fa';
import './GadgetsPage.css';

const GadgetsPage = () => {
  const navigate = useNavigate();

  const gadgets = [
    { 
      id: 1, 
      title: 'Smart Watch', 
      image: 'https://images.unsplash.com/photo-1546868871-7041f2a55e12?w=500&auto=format',
      price: '$299'
    },
    { 
      id: 2, 
      title: 'Wireless Earbuds', 
      image: 'https://images.unsplash.com/photo-1590658268037-6bf12165a8df?w=500&auto=format',
      price: '$159'
    },
    { 
      id: 3, 
      title: 'Gaming Console', 
      image: 'https://images.unsplash.com/photo-1486401899868-0e435ed85128?w=500&auto=format',
      price: '$499'
    },
    { 
      id: 4, 
      title: 'Smartphone', 
      image: 'https://images.unsplash.com/photo-1592899677977-9c10ca588bbd?w=500&auto=format',
      price: '$799'
    },
    { 
      id: 5, 
      title: 'Laptop', 
      image: 'https://images.unsplash.com/photo-1496181133206-80ce9b88a853?w=500&auto=format',
      price: '$1299'
    },
    { 
      id: 6, 
      title: 'Tablet', 
      image: 'https://images.unsplash.com/photo-1544244015-0df4b3ffc6b0?w=500&auto=format',
      price: '$649'
    }
  ];

  return (
    <div className="featured-page">
      <nav className="navbar">
        <div className="nav-left">
          <button className="back-button" onClick={() => navigate('/home')}>â€¹</button>
          <ul className="nav-links">
            <li><a onClick={() => navigate('/clothes')}>Clothes</a></li>
            <li><a onClick={() => navigate('/gadgets')}>Gadgets</a></li>
            <li><a onClick={() => navigate('/new')}>New</a></li>
            <li><a href="#featured">Featured</a></li>
            <li><a href="#barter">Barter</a></li>
          </ul>
        </div>

        <div className="nav-center">
          <h1>TECHSELL</h1>
        </div>

        <div className="nav-right">
          <button className="icon-button"><FaSearch /></button>
          <button className="icon-button"><FaShoppingCart /></button>
          <button className="icon-button"><FaUser /></button>
        </div>
      </nav>

      <div className="gadgets-grid">
        {gadgets.map(item => (
          <div key={item.id} className="gadget-card">
            <img src={item.image} alt={item.title} />
            <div className="card-overlay">
              <h2>{item.title}</h2>
              <p className="price">{item.price}</p>
              <button className="see-details-btn">See Details</button>
            </div>
          </div>
        ))}
      </div>
    </div>
  );
};

export default GadgetsPage;
